	(25, '2330', '2022-10-23 07:56:15', 'date', '股東會', '2022/06/08', '立姊禾香松能親青刃員家追誰王麻呀十。反比雄他雪彩員或草果兆候河祖牛放。借還貫爸語功更一爬包青亮們枝汗太；的比國吃請。'),
